import { Container } from "./styles";

const CardGroupDefault = () => {
  return (
    <Container>
      <div>
        <h2>
          You don't have any group yet, <br /> click on 'new group' above to
          create an habit.
        </h2>
      </div>
    </Container>
  );
};

export default CardGroupDefault;
